INSERT INTO `temples` (`id`, `image`, `heading`, `description`, `content`, `created_at`, `updated_at`) VALUES
(1, '/images/1700739820.jpg', 'Thirumangalam Temple', '108 പരശുരാമ ശിവാലയങ്ങളിൽ ഏറ്റവും പ്രധാനപ്പെട്ടതും \"തെക്കൻകാശി എന്നറിയപ്പെടുന്നതുമായ തിരുമംഗലം ശ്രീ മഹാവിഷ്ണു ശിവക്ഷേത്രം കേരളത്തിലെ തൃശ്ശൂർ ജില്ലയിൽ ഏങ്ങണ്ടിയൂർ സ്ഥിതി ചെയ്യുന്നു. കടലാക്രമണത്തെ അതിജീവിക്കാനായി മഹാദേവൻ കടലിനെ തിരിച്ചു നിർത്തി എന്ന ഐതിഹ്യത്തിൽ മഹാദേവൻ നിലകൊള്ളുന്നു. മഹാദേവന്റെ ഒപ്പം പാർവ്വതിദേവിയും, ഗണപതിയും, സുബ്രഹ്മണ്യനും സത്കുടുംബത്തോടുകൂടി നിലകൊള്ളുന്നു. സ്വയംഭൂവായ മഹാദേവന്റെ ശക്തി തണുപ്പിക്കാനായി ലക്ഷ്മീ സമേതനായ മഹാവിഷ്ണുവിനെ ഇടതുവശത്തായി മറ്റൊരു ശ്രീകോവിലിൽ പ്രതിഷ്ഠിച്ചിരിക്കുന്നു. മഹാദേവന്റെ തിരുമധുരം സേവിച്ചാൽ ജീവിതം മധുരിക്കും എന്നാണ് പഴമക്കാർ പറയുന്നത്. ഇരട്ട ശ്രീകോവിൽ ആയതിനാൽ പൂർണ്ണ പ്രതിക്ഷിണമാണ് നടത്താറുള്ളത്. സർവ്വവിധ വ്യാധികളും ബാധകളും ഉള്ളവർ മഹാദേവനെ വന്നു വാങ്ങിയാൽ നിമിഷങ്ങൾക്കകം മാറുമെന്നാണ് വിശ്വാസം.', '<ul><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\">Thirumangala Temple situated at Thirumangalam desam, Engandiyur, Thrissur District. </span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\">The Temple facing to Gurvayur Ernakulam National Highway. In this temple, there are two </span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\">idles, one is Siva and the other is Maha Vishnu. Both a have same important. But Siva is the </span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\">main Idol. Because of this temple listed in the 108 Siva temples list. The temple facing to the </span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\">eastern side and have very good Sreekovil.</span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\"><br></span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\">                     The temple by Kattumadom Mana. Many devotees reached to make relief from their </span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\">mental deceases. Devotees beleved to blesss Thirumangalathan very well. Thanthram is frm Pazhangaparambu</span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\"> Mana and the main festivals are Ashatamirohini and Sivarathri in Thirumangalam Temple. Devottes believed</span></li><li><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\"> that to offer thirumaduram to Devan and to get sweet life in their life.</span></li></ul><p><span style=\"color: rgb(0, 0, 0); font-family: \" dm=\"\" sans\";=\"\" font-size:=\"\" 18px;=\"\" text-align:=\"\" justify;\"=\"\"><br></span><span style=\"color: rgb(0, 0, 0); font-family: Play; font-size: 18px; text-align: justify;\"><br></span>              <img src=\"data:image/jpeg;base64,\" data-bs-filename=\"WhatsApp Image 2023-11-23 at 5.22.51 PM.jpeg\" style=\"width: 478.627px; height: 365.906px;\"></p><ul><li style=\"text-align: left;\"><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">സദ്ഗുരു തുടരുന്നു, \"അദ്ദേഹത്തിന് എണ്ണമറ്റ രൂപങ്ങളും പ്രകടനങ്ങളും ഉണ്ട്, എന്നാൽ അടിസ്ഥാനപരമായി, നമുക്ക് അവയെ ഏഴ് വിഭാഗങ്ങളായി തരം തിരിക്കാം. </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">ഈശ്വരൻ എന്ന് നാം വിളിക്കുന്ന വിദൂരദൈവമുണ്ട്; </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">ശംഭോ എന്ന് നാം വിളിക്കുന്ന ദയാലുവായ  ഒരു ദൈവമുണ്ട്; </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">സങ്കീർണ്ണമല്ലാത്ത ഒരു സന്യാസി അല്ലെങ്കിൽ ഭോ, അല്ലെങ്കിൽ പ്രിയപ്പെട്ട സാംബലേശ്വര അല്ലെങ്കിൽ ഭോല ഉണ്ട്; </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">ദക്ഷിണാമൂർത്തി എന്ന് നാം വിളിക്കുന്ന വേദങ്ങളുടെ ജ്ഞാനിയായ ഒരു ആചാര്യനുണ്ട്; </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">എല്ലാ കലാരൂപങ്ങളുടെയും ഉറവ, ഞങ്ങൾ അവനെ നടേശ എന്ന് വിളിക്കുന്നു; </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">ഉഗ്രൻ, ദുഷ്ടന്മാരെ നശിപ്പിക്കുന്നവൻ, നാം അവനെ കാലഭൈരവൻ അല്ലെങ്കിൽ മഹാകാല എന്നു വിളിക്കുന്നു; </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">റൊമാന്റിക്കിന്റെ ചടുലമായ വശീകരണക്കാരൻ, ഞങ്ങൾ അവനെ സോമസുന്ദര എന്ന് വിളിക്കുന്നു, അതിനർത്ഥം ചന്ദ്രനേക്കാൾ മനോഹരമാണ്. </span></font><font style=\"color: rgb(0, 0, 0); font-family: FedraSansStd-book, sans-serif; border-width: 0px; border-style: solid; border-color: var(--chakra-colors-gray-200); overflow-wrap: break-word; vertical-align: inherit;\"><span style=\"font-family: \" times=\"\" new=\"\" roman\";\"=\"\">ദശലക്ഷക്കണക്കിന് പ്രകടനങ്ങൾ ഉരുത്തിരിയാൻ കഴിയുന്ന ഏഴ് അടിസ്ഥാന രൂപങ്ങൾ ഇവയാണ്</span>.</font><br></li></ul>', NULL, '2023-11-23 07:04:33');

